import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  height: 50vh;
  background-color: black;
`;

const Logo = styled.h1`
   color: white;
`
const Desc = styled.p`
  
`
const SocialContainer = styled.h4`
  color: white;
  display: flex;
`
const SocialIcon = styled.h4`
  width: 40px;
  height: 40px;
  border-radius: 50%;
`
const Left = styled.div`
  flex: 1;
`;
const Center = styled.div`
  flex: 1;
`;
const Right = styled.div`
  flex: 1;
`;

const Fotter = () => {
  return <Container>
    <Left>
      <Logo>Isuru.</Logo>
      <Desc></Desc>
      <SocialContainer>
         <SocialIcon>
            <Facebook color="#0077ff"/>
         </SocialIcon>
         <SocialIcon>
            <Instagram color=""/>
         </SocialIcon>
         <SocialIcon>
            <Twitter color=""/>
         </SocialIcon>
         <SocialIcon>
            <Pinterest color=""/>
         </SocialIcon>
         
      </SocialContainer>
    </Left>
    <Center></Center>
    <Right></Right>
  </Container>;
};

export default Fotter;
